(61, '山嵐謐靜露營區', '0936964995', 13, '南投縣國姓鄉大長路299-2號', 61, 450, '', '【 營地收費＆進退場時間 】\r\n進場時間 ：當日上午10:00以後\r\n退場時間 ：次日下午14:00以前\r\n訪客退場時間：當日晚上10:00前\r\n＊＊＊請注意＊＊＊\r\n為了營區內露友的安全，大門開放時段為07:30至22:00,時間外大門會關上，如有特殊外出須求請洽營主\r\n＊露營收費標準：每一個露營單位【以4人/ 1車 / 1帳篷1廳】為限。\r\n（超過一人加200元，國小以下不加收。訪客ㄧ人收100元。）\r\n＊睡車上者視同收一帳800元/ 天計費。\r\n＊星期六晚上不提供夜衝服務\r\n＊如遇颱風、地震等天災，交通因中斷，經政府或旅客所在地政府發佈停止上班上課，皆可延期（確認是否要有先付訂金的規定）\r\n\r\n', '2020-11-07 13:22:00', '2020-12-07 16:36:00'),
