(705, 720, '王小明', '2020-11-20 00:00:00', 2, 4, 3, 2, 3, '環境好空氣好夜景美'),
(706, 2012061701, '珊珊', '2020-12-06 18:03:01', 4, 5, 3, 5, 4, '草地保養很好，營主的狗狗們超可愛，冰箱、冷凍設備齊全，廁所跟衛浴打掃的非常乾淨，洗澡熱水也恆溫很足夠，美中不足的是衛浴只有兩間，尖峰期要排隊一下，晚上星空很美，早上看去對面的山谷也很棒，推薦大家去的營地～'),
(707, 2012061702, '好馬', '2020-12-06 18:03:52', 4, 4, 3, 5, 4, '營區動線規劃很好，整體感覺非常舒服。營主非常用心整理而且第二天五點多起來上廁所時就看到營主已經把戲水池洗的乾乾淨淨的，讓我們非常放心的讓小孩下去玩；浴廁明亮又乾淨，使用起來一整個就是舒服；營區有冰箱可以借用很方便，真的是值得再回來的營區。'),
(708, 2012061703, '阿偉', '2020-12-06 18:04:09', 4, 5, 4, 5, 4, '這次在木棧板區搭篷，帳與帳之間距離很大，完全沒有壓迫感，活動空間很足，空氣清新非常舒服。 衛浴乾淨無異味，有專人定時清潔，但距離稍遠，建議在特定區域再加蓋會更好。 照明較不足，夜衝露友照明一定要準備；整體而言很不錯。'),
(709, 2012061704, '小孟', '2020-12-06 18:04:25', 4, 5, 3, 5, 4, '第一次露營便選了此露營區的草皮Ａ區,但因天候不佳，草地泥濘較多,影響到露營體驗，稍微可惜....浴廁方面因當天露友不多不用排隊且熱水充足又乾淨~有肥皂,也有吹風機但建議露友們還是自行準備盥洗用具較且衛生， P.S 草皮蚊子較多,做好防護便可開心露營！'),
(711, 2012062003, '王艾咪', '2020-12-06 23:58:52', 4, 3, 3, 5, 4, '草皮保養的不錯，而且離溪邊很近，可以玩水！！！超讚的露營體驗，推薦大家來玩喔。');
